"use strict";function TreeData(e,t){var n=document.querySelector(t);var r=document.createElement("div");r.className="tree";var i=buildTree(e,"father");r.innerHTML=i;n.appendChild(r)}function buildTree(e,t){var n="<li><a href='#'>"+e[t].value+"</a>";var r=[];for(var i in e){if(e[i].parent==t)r+=i}if(r.length>0){n+="<ul>";for(var i in r){n+=buildTree(e,r[i])}n+="</ul>"}return n}
